import { render } from '@testing-library/react';
import axios from 'axios';
import React from 'react';

class PersonasForm extends React.Component{

    constructor(props){
        super(props)
        this.state={}
    }
    
    //Funcion para enviar request POST al endpoint
    submitNuevaPersona(e){
        //Anular comportamiento por defecto del form
        e.preventDefault();
        //peticion con axios
        axios.post('http://localhost:3023/contactos',{
            nombre: this.ref.nombre.value,
            apellido: this.ref.apellido.value,
            email: this.ref.email.value,
            telefono: this.ref.telefono.value,
            empresa: this.ref.empresa.value

        })
    }

    render(){
        return (
            <div class="container">
               <div className="row">
                   <h4 className="center">Nuevo Contacto</h4>
                    <form className="col s12">
                        <div className="row">
                            <div className="input-field col s6">
                                <input id="nombre" ref="nombre" type="text" className="validate" />
                                <label htmlFor="nombre">Nombre: </label>
                            </div>
                            <div className="input-field col s6">
                                <input id="apellido" ref="apellido" type="text" className="validate" />
                                <label htmlFor="apellido">Apellido: </label>
                            </div>
                        </div>
                        <div className="row">
                            <div className="input-field col s6">
                                <input id="email" ref="email" type="text" className="validate" />
                                <label htmlFor="email">Email: </label>
                            </div>
                            <div className="input-field col s6">
                                <input id="telefono" ref="telefono" type="text" className="validate" />
                                <label htmlFor="telefono">Telefono: </label>
                            </div>
                            <div className="input-field col s6">
                                <input id="empresa" ref="empresa" type="text" className="validate" />
                                <label htmlFor="empresa ">Empresa: </label>
                            </div>
                            
                        </div>
                        <div>
                            <a class="waves-effect waves-light btn">button</a>
                        </div>
                    </form>
                </div>
            </div>
        )
    }
   
}

export default PersonasForm;
